import logging, urllib

from django.test import TestCase
from django.db import IntegrityError
from django.core.exceptions import ValidationError

from django_google_dork.models import SearchEngine, Campaign, Dork, Run, Result
from django_google_dork.google import Parser, ParserResult

logger = logging.getLogger(__name__)

class TestSearchEngine(TestCase):

    def setUp(self):
        pass

    def test_google_url(self):
        e = SearchEngine.objects.create(hostname="google.fr")
        c = Campaign.objects.create(name="c")
        d = Dork.objects.create(campaign=c, query='inurl:openbsd site:linuxfr.org')
        r = Run.objects.create(dork=d, engine=e)
        u = r.get_url(num=10, start=0)
        self.assertEqual(u.find("https://google.fr/search?"), 0)
        self.assertGreater(u.find("q=inurl%3Aopenbsd%20site%3Alinuxfr.org"), 0)

    def test_google_parser_regression(self):
        p = Parser(self.page1)
        self.assertEqual(p.num_results(), self.page1_num_results)
        # Verify number of results and first result only
        results = p.results["results"]
        self.assertEqual(len(results), 10)
        self.assertEqual(results[0].link_title, self.page1_r1_title)
        self.assertEqual(results[0].link_snippet, self.page1_r1_snippet)
        self.assertEqual(results[0].link_url, self.page1_r1_url)
        # Verify number of pages and first page only
        pages = p.pages
        self.assertEqual(len(pages), 9)
        self.assertEqual(pages[0], self.page1_p2)

